  height: 16px;
  margin: 7px;
  cursor: default;
}

.mwDialog .mwDialogTitleBar .mwCloseNode:focus {
  outline: 0;
  width: 14px;
  height: 14px;
  border: 1px solid #09f;
  border-radius: 3px;
}

.mwDialog .mwDialogTitleBar .mwCloseNode:focus .mwCloseSVG {
  margin: 0px;
}

.mwDialog .mwDialogTitleBar .mwCloseNode .mwCloseSVG {
  background: url(home/0.43.1/images/ui-icons_close-black-12.85798.2e32.svg) no-repeat;
  background-size: 100% 100%;
  opacity: 0.35;
  width: 14px;
  height: 14px;
  position: absolute;
  margin: 1px;
}

.mwDialog .mwDialogTitleBar .mwCloseNode .mwCloseSVG:hover {
  opacity: 0.5;
}

.mwDialog .mwDialogBody {
  overflow: auto;
  padding: 20px;
  min-height: 37px;
