  -ms-user-select: text;
  user-select: text;
}

.mwDialog .mwDialogBody.mwOverflow {
  padding-bottom: 19px;
  border-bottom: 1px solid #d9d9d9;
}

.mwDialog .mwDialogBody.mwNoButtons.mwOverflow {
  padding-bottom: 20px;
  border-bottom: none;
}

.mwDialog .mwDialogBody a {
  color: #006bd6;
}

.mwDialog .mwDialogBody a:visited {
  color: #005487;
}

.mwDialogButtonBar {
  overflow: hidden;
  border-bottom-right-radius: 5px;
  border-bottom-left-radius: 5px;
  display: flex;
  justify-content: space-between;
  padding: 5px;
}

.mwDialogButtonBar.mwNoSplBtn {
  justify-content: flex-end;
}

.mwDialogButtonBar.mwNoSplBtn .mwActionButtonBar {
  padding-left: 0px;
}

.mwDialogButtonBar .mwSplButtonBar {
  text-align: left;
  padding-right: 5px;
}

.mwDialogButtonBar .mwActionButtonBar {
  text-align: right;
  padding-left: 5px;
}

.mwDialogButtonBar .mwButton {
  background: #f5f5f5;
  border-color: #a6a6a6;
  border-style: solid;
  border-width: 1px;
  border-radius: 5px;
  display: inline-block;
  font-size: 13px;
