  transition: background-color 0.2s ease;
  transition: color 0.2s ease;
  cursor: default;
  outline: none;
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
}

.mwDialogButtonBar .mwButton:hover {
  background: #fafafa;
  border-color: #808080;
}

.mwDialogButtonBar .mwButton:active:not(.mwDisabled),
.mwDialogButtonBar .mwButton.active:not(.mwDisabled) {
  background: #e0e0e0;
