}

.mwDialogButtonBar .mwButton.mwDefaultButton:not(.mwDisabled) {
  border-width: 2px;
  margin: 4px;
  border-color: #808080;
}

.mwDialogButtonBar .mwButton.mwDisabled {
  opacity: 0.35;
}

.mwResizableHandle {
