.mw-login-widget {
    height: 100%;
    overflow: hidden;
    position: relative;
}

.mw-login-frame {
    width: 100%;
    height: 100%;
    border: 0;
}

.mw-login-dialog.mwDialog {
    min-height: 450px;
}

.mw-login-dialog.mwDialog .mwDialogBody {
    /* override embedded-styles which messes with the contents of the mw-dialog */
    box-sizing: content-box;
    padding: 0; /* Gets rid of the white/black padding around the embedded login iframe */
}

.mw-login-dialog-no-title.mwDialog {
    min-height: 420px;
}

.mw-login-dialog-no-title.mwDialog .mwDialogTitleBar {
    display: none;
}

.mw-login-dialog-no-title.mwDialog .mwDialogBody {
    background: white;
    height: calc(100% - 42px);
}

.mw-logout-widget {
    background-color: #f0f0f0;
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 20px;
    height: 100%;
}

.mw-logout-widget-message {
    height: 100%;
    width: 100%;
}

.mw-logout-widget-message .mwIconAndMessageWidgetIcon {
    box-sizing: content-box;
}

.mw-logout-widget-message .mwIconAndMessageWidgetMessage {
    height: 100%;
}

.mw-logout-widget-buttons {
    margin-top: 8px;
    align-self: flex-end;
}

.mw-logout-widget-buttons .mwPushButton {
    min-width: 68px; /* To match mw-dialogs */
    margin: 0 2px;
}

.mw-login-widget-spinner {
    display: flex;
    height: 100%;
    width: 100%;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    position: absolute;
    left: 0;
    top: 0;
    background: white;
}

.mw-login-widget-spinner-text {
    padding: 1em 2em;
    height: 1em;
    overflow: visible;
}

